Description
Starring: Riley Steele, Allie James, Lou Lou, Manuel Ferrara, Erik Everhard, Steve Holmes, Roman Nomar
Digital Playground contract superstar Riley Steele is looking for a place to live. Wanting to spice up his boring life, Manuel Ferrara lets his buddies convince him to take on a roommate. Living near a college, the hotties start flowing in and everyone is getting their turn with the nubile beauties. Fresh faced Allie James lets a more mature Steve Holmes have his way with her. Ramon Nomar rocks Lou Lou after she pops in to check out the place, then he pops all over her. Emily B. gives Manuel an invitation to open up her wanting holes. With only one room to rent, the competition is stiff! Luckily for Riley she has the hot body that all the guys want to get into. Watch as Riley works them over one at a time!
